import React from "react";
import { Routes, Route, Link, useNavigate } from "react-router-dom";
import styled from "styled-components";

const WarmingUpPage = () => {
  const navigate = useNavigate();
  return (
    <Wrap>
      <HowBox>
        <h2>게임 방법</h2>
        <Link to="step1">
          <Btn>빼빼로 만들고 키링 뽑으러 ㄱㄱ</Btn>
        </Link>
      </HowBox>
    </Wrap>
  );
};

const Wrap = styled.div`
  width: 60%;
  height: 100%;
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: center;
`;

const HowBox = styled.div`
  width: 50%;
  height: 500px;
  position: fixed;
  top: 30%;
  background-color: red;
`;

const Btn = styled.button`
  width: 80px;
  height: 30px;
  border-radius: 5px;
  border: 2px solid orange;
  display: flex;
  align-items: center;
  justify-content: center;
  font-size: 0.5rem;
  &:first-child {
    margin-right: 5%;
  }
`;

export default WarmingUpPage;
